import React, { Component } from 'react';

let User = props => {
  return (
    <div>
      <tr>
        <td>{props.id}</td>
        <td>{props.name}</td>
        <td>{props.email}</td>
        <td>
          <button
            title="Remove User"
            onClick={() => props.removeUserHandler(props.id)}
            style={{
              width: '36px',
              height: '36px'
            }}
          >
            X
          </button>
        </td>
      </tr>
    </div>
  );
};

export default User;
